using System;

public static class Snippet
{
	public static void name(AdvanceSoftware.ExcelCreator.Creator E_Creater, System.String CellName, System.String Name)
	{
		E_Creater.Cell(CellName).Attr.FontName = Name;

	}

}

using System;

public static class Snippet
{
	public static void size(AdvanceSoftware.ExcelCreator.Creator E_Creater, System.String CellName, System.Double CellSize)
	{
		E_Creater.Cell(CellName).Attr.FontPoint = CellSize;

	}

}

using System;

public static class Snippet
{
	public static void bold(AdvanceSoftware.ExcelCreator.Creator E_Creater, System.String CellName)
	{
		E_Creater.Cell(CellName).Attr.FontStyle=AdvanceSoftware.ExcelCreator.FontStyle.Bold;

	}

}

using System;

public static class Snippet
{
	public static void italic(AdvanceSoftware.ExcelCreator.Creator E_Creater, System.String CellName)
	{
		E_Creater.Cell(CellName).Attr.FontStyle = AdvanceSoftware.ExcelCreator.FontStyle.Italic;

	}

}

using System;

public static class Snippet
{
	public static void backcolor(AdvanceSoftware.ExcelCreator.Creator E_Creater, System.String CellName, System.Int16 Rclr, System.Int16 Gclr, System.Int16 Bclr)
	{

		E_Creater.Cell(CellName).Attr.BackColor = System.Drawing.Color.FromArgb(Rclr,Gclr,Bclr);
	}

}
